import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import './Tokenomics.css';

const Tokenomics = () => {
  const [activeBlock, setActiveBlock] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      setActiveBlock(prev => (prev + 1) % 4);
    }, 4000); // Reduced frequency for better performance
    return () => clearInterval(interval);
  }, []);

  return (
    <section className="tokenomics-3d">
      {/* Underwater Blockchain Visualization */}
      <div className="blockchain-ocean">
        <div className="blockchain-blocks">
          {[...Array(8)].map((_, i) => (
            <motion.div
              key={i}
              className={`blockchain-block ${i === activeBlock ? 'active' : ''}`}
              style={{
                position: 'absolute',
                left: `${10 + i * 10}%`,
                top: `${20 + (i % 3) * 20}%`,
                width: '60px',
                height: '40px',
                background: i === activeBlock 
                  ? 'linear-gradient(45deg, #00ffff, #0099ff)' 
                  : 'rgba(0, 100, 200, 0.3)',
                borderRadius: '8px',
                border: '2px solid rgba(0, 255, 255, 0.4)',
                transform: 'translateZ(20px)',
                boxShadow: i === activeBlock 
                  ? '0 0 30px rgba(0, 255, 255, 0.8)' 
                  : '0 0 15px rgba(0, 255, 255, 0.3)'
              }}
              animate={{
                y: [0, -10, 0],
                scale: i === activeBlock ? [1, 1.1, 1] : [1, 1.05, 1],
                rotate: [0, 2, -2, 0]
              }}
              transition={{
                duration: 2,
                repeat: Infinity,
                ease: "easeInOut",
                delay: i * 0.2
              }}
            />
          ))}
        </div>

        {/* Blockchain Connections */}
        <div className="blockchain-connections">
          {[...Array(7)].map((_, i) => (
            <motion.div
              key={i}
              className="blockchain-connection"
              style={{
                position: 'absolute',
                left: `${15 + i * 10}%`,
                top: `${30 + (i % 3) * 20}%`,
                width: '40px',
                height: '2px',
                background: 'linear-gradient(90deg, #00ffff, #0099ff)',
                transform: 'translateZ(15px)',
                boxShadow: '0 0 10px rgba(0, 255, 255, 0.5)'
              }}
              animate={{
                opacity: [0.3, 1, 0.3],
                scaleX: [0.8, 1.2, 0.8]
              }}
              transition={{
                duration: 3,
                repeat: Infinity,
                ease: "easeInOut",
                delay: i * 0.3
              }}
            />
          ))}
        </div>
      </div>

      <div className="container-3d">
        <motion.div
          className="tokenomics-3d-header"
          style={{
            textAlign: 'center',
            marginBottom: '3rem',
            transform: 'translateZ(50px)'
          }}
          initial={{ opacity: 0, y: 50, rotateX: -20 }}
          whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
          transition={{ duration: 1 }}
          viewport={{ once: true }}
        >
          <motion.h2 
            className="section-title"
            style={{
              fontSize: 'clamp(1.4rem, 3vw, 2rem)',
              fontWeight: '800',
              marginBottom: '2rem',
              background: 'linear-gradient(45deg, #00ffff, #0099ff, #66ccff, #00ccff)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              backgroundClip: 'text',
              textShadow: '0 0 60px rgba(0, 255, 255, 0.8)',
              transform: 'translateZ(60px)',
              lineHeight: '1.3',
              letterSpacing: '0.025em',
              wordWrap: 'break-word',
              overflowWrap: 'break-word',
              hyphens: 'auto',
              textAlign: 'center'
            }}
            animate={{ 
              textShadow: [
                '0 0 60px rgba(0, 255, 255, 0.8)',
                '0 0 80px rgba(0, 255, 255, 1)',
                '0 0 60px rgba(0, 255, 255, 0.8)'
              ]
            }}
            transition={{ 
              duration: 4,
              repeat: Infinity,
              ease: "easeInOut"
            }}
          >
            ðŸŒŠ SHARK ECONOMICS ðŸŒŠ
          </motion.h2>
          <motion.p 
            className="section-description"
            style={{
              fontSize: 'clamp(1rem, 2vw, 1.2rem)',
              color: '#ffffff',
              maxWidth: '900px',
              margin: '0 auto',
              lineHeight: '1.7',
              fontWeight: '500',
              opacity: 0.9,
              textShadow: '0 2px 20px rgba(0, 255, 255, 0.4)',
              transform: 'translateZ(30px)',
              letterSpacing: '0.01em',
              wordWrap: 'break-word',
              overflowWrap: 'break-word',
              hyphens: 'auto',
              textAlign: 'center'
            }}
            animate={{ 
              opacity: [0.8, 1, 0.8]
            }}
            transition={{ 
              duration: 3,
              repeat: Infinity,
              ease: "easeInOut"
            }}
          >
            Revolutionary tokenomics designed for maximum impact and sustainable growth in the crypto ocean
          </motion.p>
        </motion.div>

        {/* Revolutionary 3D Token Information */}
        <motion.div
          className="token-info-3d"
          style={{
            background: 'rgba(0, 50, 100, 0.2)',
            backdropFilter: 'blur(30px)',
            borderRadius: '40px',
            padding: '0.8rem',
            marginBottom: '3rem',
            position: 'relative',
            overflow: 'hidden',
            border: '2px solid rgba(0, 255, 255, 0.4)',
            boxShadow: '0 40px 80px rgba(0, 100, 200, 0.4), inset 0 1px 0 rgba(255, 255, 255, 0.1)',
            transform: 'translateZ(50px)',
            transformStyle: 'preserve-3d'
          }}
          initial={{ opacity: 0, y: 50, rotateX: -20 }}
          whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
          transition={{ duration: 1, delay: 0.2 }}
          viewport={{ once: true }}
          whileHover={{ 
            scale: 1.02,
            rotateY: 5,
            boxShadow: '0 50px 100px rgba(0, 100, 200, 0.6)'
          }}
        >
          {/* 3D Holographic Logo */}
          <motion.div
            className="holographic-logo-container"
            style={{
              display: 'flex',
              justifyContent: 'center',
              marginBottom: '2rem',
              transform: 'translateZ(60px)'
            }}
            initial={{ opacity: 0, scale: 0.5, rotateY: -180 }}
            whileInView={{ opacity: 1, scale: 1, rotateY: 0 }}
            transition={{ duration: 1.2, delay: 0.4 }}
            viewport={{ once: true }}
          >
            <motion.div
              className="holographic-logo-3d"
              style={{
                position: 'relative',
                transform: 'translateZ(80px)'
              }}
              animate={{ 
                rotateY: [0, 360],
                scale: [1, 1.1, 1]
              }}
              transition={{ 
                duration: 20,
                repeat: Infinity,
                ease: "linear"
              }}
            >
              <motion.img
                src="/whale-shark-logo.svg"
                alt="WhaleShark Logo"
                style={{
                  height: '70px',
                  width: 'auto',
                  filter: 'drop-shadow(0 0 35px rgba(0, 255, 255, 0.8)) brightness(1.3)',
                  transform: 'translateZ(30px)'
                }}
              />
              <div className="holographic-ring"></div>
              <div className="holographic-ring ring-2"></div>
              <div className="holographic-ring ring-3"></div>
            </motion.div>
          </motion.div>

          {/* 3D Token Metrics Grid */}
          <div style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
            gap: 'clamp(1rem, 3vw, 2rem)',
            marginBottom: '2rem',
            transform: 'translateZ(40px)',
            width: '100%',
            maxWidth: '100%'
          }}>
            <motion.div
              className="token-metric-3d"
              style={{
                background: 'rgba(0, 100, 200, 0.2)',
                border: '2px solid rgba(0, 255, 255, 0.4)',
                borderRadius: '25px',
                padding: '0.6rem',
                textAlign: 'center',
                backdropFilter: 'blur(20px)',
                transform: 'translateZ(30px)',
                boxShadow: '0 25px 50px rgba(0, 100, 200, 0.3)',
                position: 'relative',
                overflow: 'hidden'
              }}
              animate={{
                opacity: [0.98, 1, 0.98]
              }}
              whileHover={{ 
                y: -15, 
                scale: 1.05
              }}
              transition={{ 
                duration: 4,
                repeat: Infinity,
                ease: "easeInOut"
              }}
            >

              <h4 className="card-subtitle" style={{ 
                fontSize: 'clamp(0.6rem, 1.2vw, 0.8rem)', 
                fontWeight: '700', 
                color: '#00ffff', 
                marginBottom: '1rem', 
                textShadow: '0 0 15px rgba(0, 255, 255, 0.6)',
                transform: 'translateZ(15px)',
                letterSpacing: '0.05em',
                textTransform: 'uppercase',
                wordWrap: 'break-word',
                overflowWrap: 'break-word',
                textAlign: 'center'
              }}>
                Total Supply
              </h4>
              <motion.p 
                className="card-title"
                style={{ 
                  fontSize: 'clamp(1.2rem, 2.5vw, 1.6rem)', 
                  fontWeight: '800', 
                  color: '#ffffff', 
                  marginBottom: '0.8rem', 
                  textShadow: '0 0 20px rgba(255, 255, 255, 0.8)',
                  transform: 'translateZ(20px)',
                  letterSpacing: '0.02em',
                  wordWrap: 'break-word',
                  overflowWrap: 'break-word',
                  textAlign: 'center'
                }}
                animate={{ 
                  textShadow: [
                    '0 0 30px rgba(255, 255, 255, 0.8)',
                    '0 0 50px rgba(0, 255, 255, 1)',
                    '0 0 30px rgba(255, 255, 255, 0.8)'
                  ],
                  opacity: [0.95, 1, 0.95]
                }}
                transition={{ 
                  duration: 3,
                  repeat: Infinity,
                  ease: "easeInOut"
                }}
              >
                1B $WHALE
              </motion.p>
              <p className="card-text" style={{ 
                fontSize: 'clamp(0.5rem, 1vw, 0.7rem)', 
                color: '#ffffff', 
                opacity: 0.9,
                transform: 'translateZ(10px)',
                fontWeight: '400',
                lineHeight: '1.4',
                letterSpacing: '0.01em',
                wordWrap: 'break-word',
                overflowWrap: 'break-word',
                textAlign: 'center'
              }}>
                Fixed supply for ultimate scarcity
              </p>
            </motion.div>

            <motion.div
              className="token-metric-3d"
              style={{
                background: 'rgba(0, 150, 100, 0.2)',
                border: '2px solid rgba(0, 255, 150, 0.4)',
                borderRadius: '25px',
                padding: '0.6rem',
                textAlign: 'center',
                backdropFilter: 'blur(20px)',
                transform: 'translateZ(30px)',
                boxShadow: '0 25px 50px rgba(0, 150, 100, 0.3)',
                position: 'relative',
                overflow: 'hidden'
